"Овен Баран - он баран и есть. Всегда прав и ниибет. Проще убить сразу, чем начинать с ним спорить, потому что переспорить Овна возможно только в одном случае - если он слепоглухонемой безрукий и безногий инвалид (и то, есть огромный шанс, что даже в этом случае он все равно покажет вам хуй). Зато Овны честные. Иногда такие честные, что аж зубы сводит: предельно честно ответит, если вам не идет стрижка или платье полнит. С этим ничего не поделаешь, придется смириться (или убить, как уже говорилось выше). В домашних делах Овен, как правило, бесполезен - он умеет только генерировать гениальные идеи, а прахом бытия старается подошв не осквернять. Впрочем, если дать Овну понять, что Стрелец моет полы лучше его - костьми, сука, ляжет, но будет каждую субботу канифолить ваш паркет, потому что нет на свете вещи, которую Овен бы Стрельцу уступил. С Овном никогда не бывает скучно - этот знак обладает каким-то кармическим, сука, талантом искать приключения на свою прекрасную жопу. Легко и быстро умеет зарабатывать деньги, но бабло как гордый и принципиальный тип ненавидит, поэтому старается моментально от него избавиться При этом, сука, всегда имеет какие-то заначки, которые вообще-то гораздо приличнее иметь Деве. Из-за непроглядного распиздяйства про заначки забывает, что очень на руку сердечному другу Овна, особенно если друг этот Близнецы."
